import ReceiptNo from '@/views/receiptno/ReceiptNo.vue'

import KioskMenu from '@/views/kioskmenu/Sender.vue'
import EasyMenu from '@/views/easymenu/EasyMenu.vue'
import EasyBarcode from '@/views/easymenu/EasyBarcode.vue'
import Sender from '@/views/sender/Sender.vue'
import Receiver from '@/views/receiver/Receiver.vue'
import Goods from '@/views/sender/Sender.vue'


const routes = [
  {
    path: '/',
    name: '/',
    component:MainSilde
  },
  {
    path : '/tabletopmenu',
    name : '/tabletopmenu',
    component : TableTopMenu
  },
  {
    path : '/boxlist',
    name : '/boxlist',
    component : BoxList
  },
  {
    path : '/phone',
    name : '/phone',
    component : Phone
  },
  {
    path : '/posting',
    name : '/posting',
    component : Posting
  },
  {
    path : '/handwriter',
    name : '/handwriter',
    component : HandWriter
  },
  {
    path : '/receiptlist',
    name : '/receiptlist',
    component : ReceiptList
  },
  {
    path : '/receiptselected',
    name : '/receiptselected',
    component : ReceiptSelected
  },
  {
    path : '/measurement',
    name : '/measurement',
    component : Measurement
  },
  {
    path : '/confirmmeasurement',
    name : '/confirmmeasurement',
    component : ConfirmMeasurement
  },
  {
    path : '/ingmeasurement',
    name : '/ingmeasurement',
    component : IngMeasurement
  },
  {
    path : '/confirmreceipt',
    name : '/confirmreceipt',
    component : ConfirmReceipt
  },
  {
    path : '/confirmpayment',
    name : '/confirmpayment',
    component : ConfirmPayment
  },
  {
    path : '/printtag',
    name : '/printtag',
    component : PrintTag
  },
  {
    path : '/addtag',
    name : '/addtag',
    component : AddTag
  },
  {
    path : '/receiptno',
    name : '/receiptno',
    component : ReceiptNo
  },
  {
    path : '/kioskmenu',
    name : '/kioskmenu',
    component : KioskMenu
  },
  {
    path : '/easymenu',
    name : '/easymenu',
    component : EasyMenu
  },
  {
    path : '/easybarcode',
    name : '/easybarcode',
    component : EasyBarcode
  },
  {
    path : '/sender',
    name : '/sender',
    component : Sender
  }

]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
